import React from 'react';
import { Navbar, Container, Nav } from 'react-bootstrap';

const NavBar = ({ selectSection, activeSection }) => {
	const styles = {
		background: {
			background: 'black',
		},
		color: {
			color: '#fff',
		},
	};

	return (
		<Navbar variant='dark' expand='lg' style={styles.background}>
			<Container>
				<Navbar.Brand
					onClick={() => {
						selectSection('About Me');
					}}
					href='#top'
					style={styles.color}
					aria-current={activeSection === 'About Me' ? 'page' : undefined}
				>
					Steve Martin
				</Navbar.Brand>
				<Navbar.Toggle aria-controls='basic-navbar-nav' />
				<Navbar.Collapse id='basic-navbar-nav' className='flex-grow-0'>
					<Nav className='me-auto'>
						<Nav.Link
							onClick={() => {
								selectSection('About Me');
							}}
							style={styles.color}
							aria-current={activeSection === 'About Me' ? 'page' : undefined}
						>
							About Me
						</Nav.Link>
						<Nav.Link
							onClick={() => {
								selectSection('Project');
							}}
							style={styles.color}
							aria-current={activeSection === 'Project' ? 'page' : undefined}
						>
							Project
						</Nav.Link>
						<Nav.Link
							href='https://profile.indeed.com/p/stevem-fes275c'
							target='_blank'
							rel='noopener noreferrer'
							style={styles.color}
						>
							Resume
						</Nav.Link>
					</Nav>
				</Navbar.Collapse>
			</Container>
		</Navbar>
	);
};

export default NavBar;
